import "./form-sidebar-menu.styles.scss";

const FormSidebarMenu = () => {
	return (
		<div className="sidebar-menu">
			<ul className="list">
				<li>Contractor Master</li>
				<li>Contractor List</li>
				<li>Contractor Employee Entry</li>
				<li>Payment Details</li>
				<li>Contractor wise full Details</li>
				<li>SME Reception Entry Form</li>
				<li>SME Hralth Details Entry Form</li>
			</ul>
		</div>
	);
};

export default FormSidebarMenu;
